INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (2, 2, 8, 0, 9, 1, 3001, 2.21, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", "vo_minigame_1012_result_1081", 1, 12300149, 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (2, 2, 3, 0, 9, 1, 3001, 2.46, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", "vo_minigame_1012_result_1082", 1, 12300150, 5);
