INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (3, 2, 7, 0, 9, 1, 3001, 4.19, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", "vo_minigame_1012_result_1084", 1, 12300152, 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (3, 2, 1, 0, 9, 1, 3001, 0.0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", "vo_minigame_1012_result_1085", 1, 12300153, 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (3, 2, 3, 0, 9, 1, 3001, 2.63, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", "vo_minigame_1012_result_1086", 1, 12300154, 5);
INSERT INTO `v1_65096f13900a0151be212a4036f5c2a00f281c93e9fad444a00e194a05f36dd2` VALUES (1, 2, 3, 0, 4, 1, 3001, 5.53, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", "vo_minigame_1012_result_1087", 1, 12300155, 1);
